                <div class="CoveoDynamicFacet" data-title="Version" data-field="@version" data-number-of-values="5" data-sort-criteria="occurrences"></div>
                <div class="CoveoDynamicFacet" data-title="Version" data-field="@version" data-number-of-values="5" data-sort-criteria="occurrences"></div>
